  - id: 2
    table_name: –í—ã—Ä—É—á–∫–∞ –ø–æ —Å—Ç—Ä–∞–Ω–∞–º
    database_id: 1
    sql:
      "SELECT\n    billing_country AS \"–°—Ç—Ä–∞–Ω–∞\",\n    SUM(total) AS \"–í—ã—Ä—É—á–∫–∞\"\
      ,\n    COUNT(*) AS \"–ö–æ–ª–∏—á–µ—Å—Ç–≤–æ –∑–∞–∫–∞–∑–æ–≤\"\nFROM invoice\nGROUP BY \"–°—Ç—Ä–∞–Ω–∞\"\n\
