  - id: 3
    table_name: –¢–æ–ø-10 –∫–ª–∏–µ–Ω—Ç–æ–≤
    database_id: 1
    sql:
      "SELECT\n    c.first_name || ' ' || c.last_name AS \"–ò–º—è –∫–ª–∏–µ–Ω—Ç–∞\",\n    c.country\
      \ AS \"–°—Ç—Ä–∞–Ω–∞\",\n    SUM(i.total) AS \"–û–±—â–∞—è –≤—ã—Ä—É—á–∫–∞\"\nFROM customer c\nJOIN\
      \ invoice i ON c.customer_id = i.customer_id\nGROUP BY c.customer_id, \"–ò–º—è –∫–ª–∏–µ–Ω—Ç–∞\"\
      , \"–°—Ç—Ä–∞–Ω–∞\"\nORDER BY \"–û–±—â–∞—è –≤—ã—Ä—É—á–∫–∞\" DESC\nLIMIT 10;"
  - id: 4
    table_name: –ö–ª–∏–µ–Ω—Ç—ã –ø–æ –≥–æ—Ä–æ–¥–∞–º
    database_id: 1
    sql:
      "SELECT\n    c.city AS \"–ì–æ—Ä–æ–¥\",\n    c.country AS \"–°—Ç—Ä–∞–Ω–∞\",\n    COUNT(c.customer_id)\
      \ AS \"–ö–æ–ª–∏—á–µ—Å—Ç–≤–æ –∫–ª–∏–µ–Ω—Ç–æ–≤\",\n    SUM(i.total) AS \"–í—ã—Ä—É—á–∫–∞\"\nFROM customer\
      \ c\nJOIN invoice i ON c.customer_id = i.customer_id\nGROUP BY \"–ì–æ—Ä–æ–¥\", \"–°—Ç—Ä–∞–Ω–∞\"\
      \nORDER BY \"–í—ã—Ä—É—á–∫–∞\" DESC;"
  - id: 5
    table_name: –¢–æ–ø-10 –∞—Ä—Ç–∏—Å—Ç–æ–≤
    database_id: 1
    sql:
      "SELECT\n    ar.name AS \"–ê—Ä—Ç–∏—Å—Ç\",\n    SUM(il.unit_price) AS \"–í—ã—Ä—É—á–∫–∞\"\n\
      FROM artist ar\nJOIN album al ON ar.artist_id = al.artist_id\nJOIN track t ON\
      \ al.album_id = t.album_id\nJOIN invoice_line il ON t.track_id = il.track_id\n\
      GROUP BY \"–ê—Ä—Ç–∏—Å—Ç\"\nORDER BY \"–í—ã—Ä—É—á–∫–∞\" DESC\nLIMIT 10;"
  - id: 6
