      \nFROM media_type mt\nJOIN track t ON mt.media_type_id = t.media_type_id\nJOIN\
      \ invoice_line il ON t.track_id = il.track_id\nGROUP BY \"–¢–∏–ø –Ω–æ—Å–∏—Ç–µ–ª—è\"\nORDER\
